// src/Navbar.jsx
import { Menu, Bell } from "lucide-react";
import { useState } from "react";

export default function Navbar() {
  const [profileOpen, setProfileOpen] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  return (
    <nav className="bg-gray-900 text-white shadow-md px-6 py-3 flex items-center justify-between relative">
      {/* Left: Menu + Logo */}
      <div className="flex items-center gap-4">
        <button
          className="md:hidden focus:outline-none"
          onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
        >
          <Menu className="w-6 h-6 hover:text-blue-400 transition-colors" />
        </button>
        <span className="font-bold text-2xl tracking-wide">Doctor APS</span>
      </div>

      {/* Right: Notifications + Profile */}
      <div className="flex items-center gap-4 relative">
        <button className="relative hover:text-blue-400 transition-colors">
          <Bell className="w-6 h-6" />
          <span className="absolute top-0 right-0 h-2 w-2 bg-red-500 rounded-full"></span>
        </button>

        {/* Profile dropdown */}
        <div className="relative">
          <button
            className="flex items-center gap-2 px-3 py-1 bg-gray-800 rounded-full hover:bg-gray-700 transition-colors"
            onClick={() => setProfileOpen(!profileOpen)}
          >
            <span className="font-medium">John Doe</span>
            <img
              src="https://via.placeholder.com/30"
              alt="Profile"
              className="rounded-full w-8 h-8"
            />
          </button>

          {profileOpen && (
            <div className="absolute right-0 mt-2 w-48 bg-white text-gray-800 rounded-lg shadow-lg overflow-hidden z-50">
              <button className="w-full text-left px-4 py-2 hover:bg-gray-100 transition-colors">
                Profile
              </button>
              <button className="w-full text-left px-4 py-2 hover:bg-gray-100 transition-colors">
                Settings
              </button>
              <button className="w-full text-left px-4 py-2 hover:bg-red-500 hover:text-white transition-colors">
                Logout
              </button>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
}
